import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";

function App() {
  return (
    <div>
      <div NavBar style={{ display: "flex"}}>
        <h1 style={{paddingLeft: 150}}>ShopKart.</h1>
        <div style={{ display: "flex", paddingLeft: 200}}>
          <h3>Products</h3>
          <h3>Login</h3>
          <ShoppingCartIcon />
        </div>
      </div>
    </div>
  );
}

export default App;
